#Hacer función procesar_texto limpieza y preprocesamiento de texto específicas para el español
def procesar_texto(texto):
    if isinstance(texto, bytes):
        texto = texto.decode('utf-8', errors='ignore')
    if isinstance(texto, str) and texto.startswith("b'") and texto.endswith("'"):
        try:
            texto = eval(texto).decode('utf-8', errors='ignore')
        except:
            texto = texto[2:-1]
    texto = re.sub(r'[^a-zA-ZáéíóúÁÉÍÓÚñÑ\s]', '', texto).lower()
    tokens = word_tokenize(texto, language='spanish')
    stop_words = set(stopwords.words('spanish'))
    tokens = [p for p in tokens if p not in stop_words]
    lematizador = WordNetLemmatizer()
    tokens = [lematizador.lemmatize(p) for p in tokens]
    return ' '.join(tokens)

